  XW += x[36] * 7.0134999999999991e+01;    // C5H10
  XW += x[37] * 7.1143000000000001e+01;    // C5H11
  XW += x[38] * 1.0314399999999999e+02;    // A1C2H2
  XW += x[39] * 9.1132999999999996e+01;    // A1CH2
  XW += x[40] * 1.0612400000000000e+02;    // A1CHO
